import React from 'react';
import './Navbar.css';
const Navbar = () => {
  return (

      <ul>
        <li>
          <a>Home</a>
        </li>
        <li>
          <a>Movies</a>
        </li>
        <li>
          <a href="#">Most Popular</a>
        </li>
        <li>
          <a href="#">Top Airing</a>
        </li>
      </ul>

  );
};

export default Navbar;
